from PIL import Image
import io
import base64
import os

class Icon():
    def __init__(self) -> None:
        self.__icon_default = b''
        pass

    def default(self):
        image = Image.open(io.BytesIO(base64.b64decode(self.__icon_default)))
        return image

    def custom(self):
        image = Image.open("icon.ico") if os.path.exists("icon.ico") else self.default()
        return image
    
    def close(self):
        image = Image.open(io.BytesIO(base64.b64decode()))
        return image